import RegisterLayout from "../components/RegisterLayout";

// const Index = () => <RegisterLayout/>;

function Register() {
  return (
    <RegisterLayout>
      <Link href="/">
        <div className="menu-tile">
          <span>Marki</span>
        </div>
      </Link>

      <div className="menu-tile">
        <span>Prywatni<br />wystawcy</span>
      </div>
    </RegisterLayout>
  )
}

export default Index;
